import theme from '../theme.png';
import padlock from '../padlock.png'
import { useState } from 'react';
export function Settings(){
    const [state, set_state] = useState(1);
    const toggleTab = (index)=>{
        set_state(index);
    }
    return(
    <>
        <span>
            Settings
        </span>
        <div class="main_settings" onClick={()=> toggleTab(1)}>
            <div class="settings_item">
                Theme
                <img src={theme} alt="" />
            </div>
            <div class="settings_item">
                Privacy
                <img src={padlock} alt=""/>
            </div>
            <div class="settings_item">
                Some
            </div>
        </div>
        <div class="settings_usage">
            
        </div>
    </>
    );
}
